import React, { useState, useRef } from 'react';

const LOGO_BASE64 = "";

const SOGETRA = {
  name: "SOGETRA",
  fullName: "SOGETRA SARL",
  capital: "200.000.000f CFA",
  address: "Abidjan-Treichville Rue des pcheurs - 18 BP 601 Abidjan 18",
  cc: "1723703 G",
  rccm: "CI-ABJ-03-2017-B12-11882",
  tel: ["00225 27.21.25.72.75", "00225 27.21.22.22.70", "00225 01.03.22.22.69"],
  signataire: "Michael TOUMA",
  fonction: "Le Grant",
  contacts: ["+1 202 604 4402 (WhatsApp)", "+225 01 03 33 33 31 (cel)"]
};

export default function CourrierGenerator() {
  const today = new Date();
  const iframeRef = useRef(null);
  const [formData, setFormData] = useState({
    date: today.toLocaleDateString('fr-FR', { day: 'numeric', month: 'long', year: 'numeric' }),
    destinataire: '',
    reference: `SGT/DG/${today.getFullYear()}/${String(today.getMonth()+1).padStart(2,'0')}-`,
    objet: '',
    corps: '',
    pj: '',
    copies: ''
  });
  const [view, setView] = useState('form');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const getPrintHTML = () => `<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <title>Courrier SOGETRA</title>
  <style>
    @page { size: A4; margin: 15mm 20mm 25mm 20mm; }
    * { margin: 0; padding: 0; box-sizing: border-box; }
    body { font-family: 'Times New Roman', Times, serif; font-size: 12pt; line-height: 1.5; color: #000; padding: 20px; }
    .header { margin-bottom: 5px; }
    .logo { height: 80px; }
    .green-line { height: 3px; background: #228B22; margin: 10px 0 20px 0; }
    .date { text-align: right; margin-bottom: 20px; }
    .destinataire { margin-bottom: 15px; white-space: pre-line; font-weight: bold; }
    .ref-objet { margin-bottom: 15px; }
    .ref-objet p { margin-bottom: 5px; }
    .separator { border-top: 1px solid #000; margin: 15px 0; }
    .corps { text-align: justify; white-space: pre-line; margin-bottom: 30px; }
    .signature { text-align: right; margin-top: 40px; }
    .signature p { margin-bottom: 3px; }
    .signature .name { font-weight: bold; margin-top: 50px; }
    .pj-copies { margin-top: 30px; font-size: 11pt; }
    .pj-copies p { margin-bottom: 5px; }
    .footer { position: fixed; bottom: 10mm; left: 20mm; right: 20mm; text-align: center; font-size: 9pt; }
    .footer-line { height: 2px; background: #228B22; margin-bottom: 8px; }
    .footer p { margin-bottom: 2px; color: #333; }
  </style>
</head>
<body>
  <div class="header">
    <img src="data:image/jpeg;base64,${LOGO_BASE64}" class="logo" alt="SOGETRA">
  </div>
  <div class="green-line"></div>
  <div class="date">Abidjan, le ${formData.date}</div>
  <div class="destinataire">${formData.destinataire || '[Destinataire]'}</div>
  <div class="ref-objet">
    <p><strong>N/Rf :</strong> ${formData.reference}</p>
    <p><strong>Objet :</strong> ${formData.objet || '[Objet]'}</p>
  </div>
  <div class="separator"></div>
  <div class="corps">${formData.corps || '[Corps du courrier]'}</div>
  <div class="signature">
    <p>Pour ${SOGETRA.fullName}</p>
    <p class="name">${SOGETRA.signataire}</p>
    <p><em>${SOGETRA.fonction}</em></p>
    <p style="font-size:10pt; margin-top:10px;">${SOGETRA.contacts.join(' / ')}</p>
  </div>
  ${formData.pj ? `<div class="pj-copies"><p><strong>P.J :</strong> ${formData.pj}</p></div>` : ''}
  ${formData.copies ? `<div class="pj-copies"><p><strong>Copies :</strong> ${formData.copies}</p></div>` : ''}
  <div class="footer">
    <div class="footer-line"></div>
    <p><strong>${SOGETRA.fullName}</strong> au Capital de ${SOGETRA.capital}</p>
    <p>${SOGETRA.address}</p>
    <p>C.C ${SOGETRA.cc} - RCCM ${SOGETRA.rccm}</p>
    <p>Tl: ${SOGETRA.tel.join(' / ')}</p>
  </div>
</body>
</html>`;

  const handlePrint = () => {
    const iframe = iframeRef.current;
    const doc = iframe.contentDocument || iframe.contentWindow.document;
    doc.open();
    doc.write(getPrintHTML());
    doc.close();
    
    // Attendre que le contenu soit charg puis imprimer
    setTimeout(() => {
      iframe.contentWindow.focus();
      iframe.contentWindow.print();
    }, 500);
  };

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <iframe ref={iframeRef} style={{position:'absolute',width:0,height:0,border:'none'}} title="print" />
      
      <div className="max-w-4xl mx-auto">
        <div className="bg-white rounded-lg shadow-lg p-6 mb-4">
          <div className="flex items-center justify-between mb-6 flex-wrap gap-4">
            <img src={`data:image/jpeg;base64,${LOGO_BASE64}`} alt="SOGETRA" className="h-16" />
            <div className="flex gap-2 flex-wrap">
              <button onClick={() => setView('form')} className={`px-4 py-2 rounded ${view === 'form' ? 'bg-green-700 text-white' : 'bg-gray-200'}`}>
                Formulaire
              </button>
              <button onClick={() => setView('preview')} className={`px-4 py-2 rounded ${view === 'preview' ? 'bg-green-700 text-white' : 'bg-gray-200'}`}>
                Aperu
              </button>
              <button onClick={handlePrint} className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700 font-medium">
                 Imprimer / PDF
              </button>
            </div>
          </div>

          {view === 'form' ? (
            <div className="space-y-4">
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium mb-1">Date</label>
                  <input type="text" name="date" value={formData.date} onChange={handleChange} 
                    className="w-full p-2 border rounded" />
                </div>
                <div>
                  <label className="block text-sm font-medium mb-1">Rfrence</label>
                  <input type="text" name="reference" value={formData.reference} onChange={handleChange}
                    className="w-full p-2 border rounded" />
                </div>
              </div>
              <div>
                <label className="block text-sm font-medium mb-1">Destinataire</label>
                <textarea name="destinataire" value={formData.destinataire} onChange={handleChange}
                  placeholder={"Monsieur le Directeur Gnral\nENTREPRISE XYZ\nAbidjan"}
                  className="w-full p-2 border rounded h-24" />
              </div>
              <div>
                <label className="block text-sm font-medium mb-1">Objet</label>
                <input type="text" name="objet" value={formData.objet} onChange={handleChange}
                  className="w-full p-2 border rounded" />
              </div>
              <div>
                <label className="block text-sm font-medium mb-1">Corps du courrier</label>
                <textarea name="corps" value={formData.corps} onChange={handleChange}
                  placeholder={"Monsieur le Directeur Gnral,\n\nNous avons l'honneur de..."}
                  className="w-full p-2 border rounded h-64 font-serif" />
              </div>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium mb-1">Pices jointes</label>
                  <input type="text" name="pj" value={formData.pj} onChange={handleChange}
                    className="w-full p-2 border rounded" />
                </div>
                <div>
                  <label className="block text-sm font-medium mb-1">Copies</label>
                  <input type="text" name="copies" value={formData.copies} onChange={handleChange}
                    className="w-full p-2 border rounded" />
                </div>
              </div>
            </div>
          ) : (
            <div className="bg-white border-2 border-gray-300 p-8 font-serif" style={{minHeight: '800px'}}>
              <img src={`data:image/jpeg;base64,${LOGO_BASE64}`} alt="SOGETRA" className="h-20 mb-2" />
              <div className="h-1 bg-green-700 mb-6"></div>
              <p className="text-right mb-6">Abidjan, le {formData.date}</p>
              <p className="font-bold whitespace-pre-line mb-4">{formData.destinataire || '[Destinataire]'}</p>
              <p className="mb-1"><strong>N/Rf :</strong> {formData.reference}</p>
              <p className="mb-4"><strong>Objet :</strong> {formData.objet || '[Objet]'}</p>
              <hr className="border-black mb-4" />
              <div className="whitespace-pre-line text-justify mb-8" style={{minHeight: '300px'}}>
                {formData.corps || '[Corps du courrier]'}
              </div>
              <div className="text-right mt-12">
                <p>Pour {SOGETRA.fullName}</p>
                <p className="font-bold mt-12">{SOGETRA.signataire}</p>
                <p className="italic">{SOGETRA.fonction}</p>
              </div>
              {formData.pj && <p className="mt-8"><strong>P.J :</strong> {formData.pj}</p>}
              {formData.copies && <p><strong>Copies :</strong> {formData.copies}</p>}
              <div className="mt-12 pt-4 border-t-2 border-green-700 text-center text-xs">
                <p><strong>{SOGETRA.fullName}</strong> au Capital de {SOGETRA.capital}</p>
                <p>{SOGETRA.address}</p>
                <p>C.C {SOGETRA.cc} - RCCM {SOGETRA.rccm}</p>
                <p>Tl: {SOGETRA.tel.join(' / ')}</p>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}


